script: |
  super -f text -I q5826.spq | sort > q5826.out

inputs:
  - name: q5826.spq
    data: |
      SELECT ALL 25 / + COUNT ( * ) col0 FROM tab1 (FORMAT parquet) cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT - 81 / 7 * - 99 + + 19 BETWEEN + - 40 AND + + 1;
  - name: tab1
  - name: tab2

outputs:
  - name: q5826.out
    data: |
      2
